import React,{useState,useEffect} from 'react'


const Display = () => {
    
    const [displays,setDisplays]=useState([]);
    const getData=async()=>{
        try {
            const data= await fetch("/display")
            if(data.ok){
                const result=await data.json();
                console.log(result);
            }
        } catch (error) {
            console.log(error)
        }
    }
    useEffect(() => {
        getData();
    }, [])
    return (
        <div>
            <h1>Display</h1>
            <p></p>
        </div>
    )
}

export default Display
